                    if (width < height) {
                        var aspectRatio = height / width;
                        MAX_WIDTH = MAX_HEIGHT;
                        MAX_HEIGHT = MAX_WIDTH * aspectRatio;
                    }
                    else {
                        var aspectRatio = width / height;
                        MAX_WIDTH = MAX_HEIGHT * aspectRatio;
                    }
